import './App.css';

const Task = (value) => {
  return (
    <li key={value}>
      {value}
    </li>
  );
}

const compromissos = ['Estudar', 'Jogar futebol', 'Alimentar o Pet'];
const lista = compromissos.map((compromisso) => Task(compromisso));
function App() {

  return lista;
}

export default App;
